```javascript
function find_golden_number(n) {
    var digits_in_number = 1, max_digit_value = 9;
    while (n > digits_in_number * max_digit_value) {
        n -= digits_in_number * max_digit_value;
        digits_in_number += 1;
        max_digit_value *= 10;
    }
    var start_number = Math.pow(10, digits_in_number - 1) + (Math.floor(n / digits_in_number)) - 1;
    if (n % digits_in_number == 0) {
        return start_number % 10;
    }
    return parseInt(String((start_number + 1)).charAt((n % digits_in_number) - 1));
}
